var randrange = function (bottom, top) {
    return Math.floor(Math.random() * (top - bottom )) + bottom;
}

var text_to_code = function (text) {
    var morseMsg = '';
    for (i = 0; i < text.length; i++) {
        if (text[i] != ' ') {
            character = kood[text[i].toUpperCase()];
            (i != text.length - 1) ? morseMsg += character + ' ' : morseMsg += character;
        }
        else {
            morseMsg += '\t';
        }
    }
    return morseMsg
}

function code_to_playlist(mMsg) { //võtab argumendina sisse morsekoodi sõnena
    playlist = [];
    mItem = ''
    for (i = 0; i < mMsg.length; i++) {
        if (mMsg[i] == '.') {
            mItem = 'dot'
        } //dot – lühike signaal
        else if (mMsg[i] == '-') {
            mItem = 'dash'
        } //dash – pikk signaal
        else if (mMsg[i] == ' ') {
            mItem = ' '
        } //tühik jäätakse tähtese vahel
        playlist.push(mItem);
    }
    return playlist; //tagastab esitusloendi signaali mängimiseks järjendi faili nimedest
}


function play_morse(playlist, word_index) {

    kiirus = parseFloat($('#speed').val());
    helitugevus = parseFloat($('#heli_tugevus').val());
    audio_play = true;
    $(replay).fadeTo(500, 0);
    if (word_index == 0) {
        paint_word(word_index);
    } //muudab mängitava hetkel mängitava tähe värvi
    audio = new Audio();
    morse_symbol = playlist.shift();
    audio.src = "SOUND/" + morse_symbol + '.mp3';
    audio.loop = false;
    audio.volume = helitugevus;
    audio.playbackRate = kiirus;

    audio.play();
    $(alpha).css('background-color', 'brown');


    audio.addEventListener("ended", function () {

        if (playlist.length > 0) {

            morse_symbol = playlist.shift();
            //console.log(morse_symbol, playlist.length);
            if (morse_symbol != ' ') {
                audio.src = "SOUND/" + morse_symbol + '.mp3';

                audio.playbackRate = kiirus;
                audio.play();
                $('#alpha').css('background-color', 'yellow');
            }
            else {
                word_index += 1;
                paint_word(word_index);


                setTimeout(function () {
                    play_morse(playlist, word_index)
                }, ~~300 / kiirus);

            }
        }
        else {
            audio_play = false;

            if (game) {
                $(s).hide();
                $(replay).fadeTo(1000, 1);
            }
            if (word_index == 101) {
                $(symbol).css('background-color', 'pink');
            }
        }
    });
}

function paint_word(indx) {

    $('.' + indx.toString()).css('color', 'red');
    if (indx > 0) {
        $('.' + (indx - 1).toString()).css('color', 'black');
    }
    if (arvatav_sona.length == indx + 1) {
        setTimeout(function () {
            $('.' + indx.toString()).css('color', 'black');
        }, 2000);
    }
}


function find_word_for_guess() {

    if (sonad.length < 100) {
        sonad = koik_sonad.slice();
    }
    arvatav_sona = sonad.splice(randrange(0, sonad.length), 1)[0]; //leiab arvatava sõna ja samas eemaldab selle sonade järjendist
    morse_kood = text_to_code(arvatav_sona);
    pList = code_to_playlist(morse_kood);

    return arvatav_sona;
}

function show_results(valed, punktid) {

    $('#valed').text('Vead : ' + vead);
    $('#punktid').text('Punktid : ' + punktid);
    $('#sonad').css({'width': '200px', 'color': 'green'}).text('Arvatud : ' + guessed_words + ' sõna');


    if (web_storage) {
        high_score = localStorage.getItem("high_score");

        if (high_score !== null) {
            high_score = high_score.split(' ');
            rekord = '(Rekord : ' + high_score[0] + ' punkti / ' + high_score[1] + ' sõna' + ')';


            $('#rekord').css({'color': 'red', 'width': '300px'}).text(rekord);

        }
    }

}

function game_session(status) {
    if (status) {
        if (typeof(Storage) !== "undefined") {
            web_storage = true;
            $('#game_counter').text(localStorage.getItem("game_count"));
        }
        any_action = true;
        game = true;
        sessioon = true;
    }
    else {
        if (web_storage) {
            n = localStorage.getItem("game_count");
            if (n === null) {
                n = 1;
            }
            else {
                n = parseInt(n) + 1;
            }
            localStorage.setItem("game_count", n.toString());
            console.log(' MÄNG nr: ' + n.toString());

            high_score = punktid.toString() + ' ' + guessed_words.toString();
            parim = localStorage.getItem("high_score");

            if (parim === null) {
                localStorage.setItem("high_score", high_score);
            }
            else {
                parim = parseInt(parim.split(' ')[0])
                if (parim < punktid) {
                    localStorage.setItem("high_score", high_score);
                }

            }
        }
        punktid = 0;
        vead = 0;
        guessed_words = 0;
        game = false;
        sessioon = false;
        morse_alpha_table();
    }

}

function hangman() { // Käivitab poomismängu stiilis arvamismängu, kus arvatavat sõna mängitakse morsesignaali kujul

    $('#alpha').html('');
    $('#pilt').html($('<img src="PICS/' + vead.toString() + '.png">'));

    var alpha = 'ABCDEFGHIJKLMNOPQRSTUVÄÖÜÕWXYZ';
    $.each(alpha.split(''), function (i, val) {
        val_morse = ' ' + kood[val];
        $('#alpha').append($('<div class="guess" STYLE="color: red;">' + val + '<span STYLE="color: blue;">' + val_morse + '</span> </div>'));
    });
    $.each(word.split(''), function (i, val) {

        $('#word').append($('<span class=' + i + ' letter="' + val + '">_</span>'));
    });
    $('.guess').click(function () {

        any_action = true;

        t2ht = $(this).text()[0]; //täht, mida pakuti
        if (game) {
            var count = $('#word [letter=' + t2ht + ']').each(function () {
                $(this).text($(this).attr('letter'));
            }).length; //loendur count loeb kokku mitu tähte oli arvatavas sõnas

            $(this).removeClass('guess').css('color', (count > 0 ? 'limegreen' : 'red')).unbind('click');

            $(this).fadeOut(1000);

            if (count == 0) { //Kui pakutud tähte ei olnud sõnad...

                vead++; //vigade loendur = +1
                if (punktid > 0) {
                    punktid -= 1;
                } // Kui punkte on rohkem kui 0, siis võetakse iga vea korral 1 punkt maha, aga kui juba on 0, siis negatiivseid punkte ei teki

                show_results(vead, punktid);

                $('#pilt').html($('<img src="PICS/' + vead.toString() + '.png">')); //näitame uut pilti

                if (vead == 7) {  //Kui on tehtud 7 viga, siis on mäng läbi
                    $(s).show();
                    $(s).text('PROOVI UUESTI!');
                    game_session(false);
                    $(replay).hide();
                    morse_alpha_table();

                    $('#word span').each(function (index) { //Näitame arvamatta jäänud sõna
                        if ($(this).text() == '_') {
                            $(this).text($(this).attr('letter'));
                        }
                    });
                }
            }

            else {          //Kui pakutud täht on arvatavas sõnas
                punktid++;
                $(s).text('JÄRGMINE SÕNA!');

                show_results(vead, punktid);
            }

            closed_count = 0;
            $('#word span').each(function (index) {
                if ($(this).text() == '_') {
                    closed_count += 1;
                }
            });

            if (closed_count == 0 & game) {
                $(s).show();
                game = false; //Kõik sai arvatud, arvaja jäi ellu!

                $('#pilt').html($('<img src="PICS/elus.png">'));

                $(replay).hide();
                guessed_words++;

                show_results(vead, punktid);
                console.log(guessed_words);

                morse_alpha_table();
            }
        }
    });
}


function morse_alpha_table() {

    $('#alpha').html('');
    $.each(kood, function (index, value) {
        $('#alpha').append($('<div id="symbol"><span STYLE="color: red;">' + index + '</span ><span>  ' + value + '</span></div>'));

    });
    $(symbol).click(function () {
        chr = $(this).text()[0];
        // console.log('morse symbol: ',chr)

        if (!audio_play) { //Kui parasjagu midagi muud ei mängi...
            play_morse(code_to_playlist(text_to_code(chr)), 101);
            $(this).css('background-color', 'yellow');
        }

    });
}

function check_if_sleep(n) {
    if (any_action) {
        n = 0;
        any_action = false;
    }
    n++;
    //console.log(n);
    if (n === aegumine) {
        game_session(false);
        $('#speed').text('1.0');
        $('#rate').val('1.0');
        beginning(); //läheme tagasi beginningesse ja muudame signaalikiiruse tagasi algsele väärtusele (1.0)
        $('#heli_tugevus').text('0.5');
        $('#volume').val('0.5');
    }

    setTimeout(function () {
        check_if_sleep(n)
    }, 60000);
}

function beginning() {

    any_action = false;
    $(replay).hide();
    $(s).text('START');
    $(s).show();
    $('#word').css('font-size', '22px').text(sissejuhatus);
    $('#valed').text('');
    $('#punktid').text('');
    $('#sonad').text('');
    $('#pilt').html($('<img src="PICS/morse_anima_v2.gif">'));

}

$(document).ready(function () {

    if (typeof(Storage) !== "undefined") {
        web_storage = true;
        $('#game_counter').text(localStorage.getItem("game_count"));
    }
    beginning();
    $(replay).hide();
    check_if_sleep(0);


    $(s).click(function () {
        //hävitame olemasolevad elemndid, vajalik kui eelnevalt on sõnu juba arvatud!
        sessioon = true;

        $(s).fadeOut(500);

        $('#word').html('');

        game_session(true);
        vead = 0;
        arvatav_sona = find_word_for_guess();

        pList = code_to_playlist(text_to_code(arvatav_sona));

        word = arvatav_sona.toUpperCase();

        hangman();
        show_results(vead, punktid);
        setTimeout(function () {
            play_morse(pList, 0);
        }, 300);

    });

    $(replay).click(function () {
        //hävitame olemasolevad elemndid, vajalik kui eelnevalt on sõnu juba arvatud!
        if (!audio_play) {
            pList = code_to_playlist(text_to_code(arvatav_sona));
            play_morse(pList, 0);
        }
        any_action = true;

    });
    morse_alpha_table();

});
